import React from 'react'

class User extends React.Component {
    state = {
        user: {}
    }

    componentDidMount = () => {
        fetch(`/api/users/${this.props.match.params.userId}`)
            .then(res => res.json())
            .then(user => {
                this.setState({user})
            })
    }

    render() {
        const user = this.state.user;
        return (
            <div>
                <h1>{user.name}</h1>
                <h3>{user.username}</h3>
            </div>
        )
    }
}

export default User
